import React from 'react'
import './MySkills.css'
import LinearProgress from '@material-ui/core/LinearProgress';
import { makeStyles, withStyles } from '@material-ui/core/styles';


const BorderLinearProgress = withStyles((theme) => ({
    root: {
      height: 12,
      borderRadius: 5,
    },
    colorPrimary: {
      backgroundColor: theme.palette.grey[theme.palette.type === 'light' ? 200 : 700],
    },
    bar: {
      borderRadius: 5,
      backgroundColor: '#1a90ff',
    },
  }))(LinearProgress);









export default function MySkills() {
    return (
        <div className="MySkills-parents">
            <div class="html bar one">
                <div className="skills-icon">  </div>
                <div className="skills-bar">    <BorderLinearProgress className="BorderLinearProgress" variant="determinate" value={80} />    </div> 
            </div>

            
            <div class="css bar two">
                <div className="skills-icon">  </div>
            </div>

            
            <div class="javaScript bar one">
                <div className="skills-icon">  </div>
            </div>

            
            <div class="react bar two">
                <div className="skills-icon">  </div>
            </div>

            
            <div class="nodejs bar one">
                <div className="skills-icon">  </div>
            </div>

            
            <div class="mongodb bar two">
                <div className="skills-icon">  </div>
            </div>
        </div>
    )
}
